import React from "react";
import { InputNumber, InputGroup } from 'rsuite';

export default function InputVector3(props) {
    return (
      <div>
        <InputGroup >
            <InputNumber prefix="x" defaultValue="0"/>
            <InputNumber prefix="y" />
            <InputNumber prefix="z" />
        </InputGroup>
      </div>
    );
  };
